export const ADD = 'users:addUsersAction';
export const REMOVE = 'users:removeUsersAction';
export const SEND = 'app:dispatchUsersAction';


export const addUsersAction = (id) => {
    return {
        type: ADD,
        payload: {
            id: id
        }

    }
}

export const removeUsersAction = (id) => {
    return {
        type: REMOVE,
        payload: {
            id: id
        }

    }
}

export const dispatchUsersAction = (users) => {
    return {
        type: SEND,
        payload: {
            users: users
        }

    }
}
